import { Carousel } from "react-bootstrap";
import "../styling/hero.css";
import hero1 from "../assets/hero/hero1.jpg";
import hero2 from "../assets/hero/hero2.jpg";
import hero3 from "../assets/hero/hero3.jpg";
import hero4 from "../assets/hero/hero4.jpg";

export const Hero = () => {
  return (
    <div className="hero">
      <Carousel fade>
        <Carousel.Item>
          <img src={hero1} alt="" />
          <Carousel.Caption>
            <h3>Yours truly</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={hero2} alt="fuji" />
          <Carousel.Caption>
            <h3>Mt Fuji: 3770m</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={hero3} alt="boat" />
          <Carousel.Caption>
            <h3>Boat on Ishigaki Island</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={hero4} alt="heart" />
          <Carousel.Caption>
            <h3>Pen Sketch</h3>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};
